    [4740] = "Find and slay the murloc known as Murkdeep.  The creature is thought to be defending the murloc huts south of Auberdine along the water.\n\nReport the death of Murkdeep to Sentinel Glynda Nal'Shea in Auberdine.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - 1 x Murkdeep",
    [4761] = "Speak with Thundris Windweaver in Auberdine.",
    [4762] = "Travel north of Auberdine to the first waterfall along the Cliffspring River and draw a sample from the pool there.\n\nReturn to Thundris Windweaver in Auberdine with the Cliffspring River Sample.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - 1 x Cliffspring River Sample",
    [4763] = "Fill the Empty Cleansing Bowl at the Auberdine Moonwell.\n\nGather a sample of fruit, nut, and grain from the northern Blackwood furbolg camps.\n\nMix the bowl and place it near the bonfire closest to the Cliffspring River at the northern camp, thus summoning the satyr corruptor.\n\nTake the Talisman of Corruption and bring it to Thundris Windweaver in Auberdine.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - 1 x Talisman of Corruption",
    [4767] = "Bring 10 Highperch Wyvern Eggs to Elu in Freewind Post.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - 10 x Highperch Wyvern Egg",
    [4770] = "Escort Pao'ka Swiftmountain from Highperch, and then talk to Motega Firemane in Whitereach Post.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Escort Pao'ka from Highperch",
    [4811] = "Travel east of Auberdine and look for a large, red crystal along Darkshore's eastern mountain range.  Report back what you find to Sentinel Glynda Nal'Shea in Auberdine.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Locate the large, red crystal on Darkshore's eastern mountain range",
    [4812] = "Fill the Empty Water Tube at the Auberdine moonwell, and then investigate the red crystal along Darkshore's eastern mountain wall.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - 1 x Moonwell Water Tube",
    [4813] = "Report back what you have found to Sentinel Glynda Nal'Shea in Auberdine.",
    [4821] = "Return the Alien Egg to Hagar Lightninghoof in Freewind Post.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - 1 x Alien Egg",
    [4841] = "Kill 12 Galak Scouts, 10 Galak Wranglers, and 6 Galak Windchasers, and then return to Cliffwatcher Longhorn in Freewind Post.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - 12 x Galak Scout\n - 10 x Galak Wrangler\n - 6 x Galak Windchaser",
    [4865] = "Report your findings to Motega Firemane.",
