    [5928] = "Speak with Turak Runetotem on the Elder Rise of Thunder Bluff.",
    [5929] = "Seek out the Great Bear Spirit in northwestern Moonglade and learn what it has to share with you about the nature of the bear.  When finished, return to Dendrite Starblaze in Nighthaven, Moonglade.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Seek out the Great Bear Spirit and learn what it has to share with you about the nature of the bear.",
