    [5932] = "Return to Thunder Bluff and speak with Turak Runetotem on the Elder Rise.",
    [6001] = "Use the Cenarion Moondust on the Moonkin Stone of Auberdine to bring forth Lunaclaw.  From there, you must face Lunaclaw and earn the strength of body and heart it possesses.\n\nSpeak with Mathrengyl Bearwalker in Darnassus when you are done.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Face Lunaclaw and earn the strength of body and heart it possesses.",
