    [6062] = "Use the Taming Rod to tame a Dire Mottled Boar. Practice your skills, then return the Taming Rod to Thotar in Razor Hill.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Tame a Dire Mottled Boar",
    [6063] = "Use the Taming Rod to tame a Webwood Lurker. Practice your skills, then return the Taming Rod to Dazalar in Dolanaar.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Tame a Webwood Lurker",
    [6064] = "Use the Taming Rod to tame a Large Crag Boar. Practice your skills, then return the Taming Rod to Grif Wildheart in Kharanos.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Tame a Large Crag Boar",
