    [6088] = "Use the Taming Rod to tame a Swoop. Practice your skills, then return the Taming Rod to Yaw Sharpmane in Bloodhoof Village.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Tame a Swoop",
