    [6102] = "Use the Taming Rod to tame a Strigid Screecher. Practice your skills, then return the Taming Rod to Dazalar in Dolanaar.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Tame a Strigid Screecher",
    [6103] = "Speak to Jocaste in the Cenarion Enclave, in Darnassus.",
    [6121] = "Travel to Moonglade and speak with Dendrite Starblaze in the village of Nighthaven.",
    [6122] = "Use the Empty Cliffspring Falls Sampler to draw a sample of water from the mouth of the cave by the falls.\n\nDeliver the Filled Cliffspring Falls Sampler to Alanndarian Nightsong in Auberdine, Darkshore.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - 1 x Filled Cliffspring Falls Sampler",
