    [6124] = "Use the Curative Animal Salve on 10 Sickly Deer that are located throughout Darkshore; doing so should cure them.  Sickly Deer have been reported starting south of the Cliffspring River to the north of Auberdine and extending all the way into southern Darkshore where the edge of Ashenvale begins.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - 10 x Sickly Deer cured",
