    [6130] = "Return to Turak Runetotem on the Elder Rise, Thunder Bluff.",
    [6161] = "Find Rackmore's Silver Key.  Find Rackmore's Golden Key.  Find and open Rackmore's Chest.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - 1 x Rackmore's Silver Key\n - 1 x Rackmore's Golden Key",
