    [3568] = "Fill all 4 Empty Vials at the tide pools along the coast of the Ruins of Eldarath in Azshara before returning to Chemist Cuely.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Filled Vial Labeled #1 x 1\n - Filled Vial Labeled #2 x 1\n - Filled Vial Labeled #3 x 1\n - Filled Vial Labeled #4 x 1",
