    [3845] = "Examine the items inside the pack and bring them to their owner.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Large Compass x 1\n - Curled Map Parchment x 1\n - Lion-headed Key x 1",
    [3881] = "Bring a Crate of Foodstuffs and Research Equipment to Williden Marshal in Un'Goro Crater.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Crate of Foodstuffs x 1\n - Research Equipment x 1",
    [3882] = "Bring 8 Dinosaur Bones to Spark Nilminer in Un'Goro Crater.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Dinosaur Bone x 8",
    [3883] = "Use the Scraping Vial to collect a Hive Wall Sample from one of the Gorishi hive hatcheries in Un'Goro Crater.  Look for the chambers with the hanging larval spawns.\n\nBring the Hive Wall Sample to Hol'anyee Marshal in Un'Goro Crater.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Hive Wall Sample x 1",
    [3884] = "Return the journal to Williden Marshal somewhere in Un'Goro Crater.",
    [3908] = "Take Linken's Sword to Donova Snowden in Winterspring.",
    [4022] = "Show Cyrus Therepentous the Black Dragonflight Molt you received from Velarok Windblade.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Black Dragonflight Molt x 1\n - Proof Presented",
    [4061] = "Venture to the Burning Steppes and recover 10 Fractured Elemental Shards for Hierophant Theodora Mulvadania.\n\nYou recall Theodora mentioning the golems and elementals of that region as being a source for these shards.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Fractured Elemental Shard x 10",
    [4101] = "Bring 15 Blood Amber to Arathandris Silversky in Felwood.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Blood Amber x 15",
    [4102] = "Bring 15 Blood Amber to Maybess Riverbreeze in Felwood.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Blood Amber x 15",
    [4103] = "|Cffffd100Requirements:|r\n - Corrupted Soul Shard x 6",
    [4120] = "Talo Thornhoof at Camp Mojache in Feralas wants you to kill 12 Angerclaw Grizzlies and 12 Felpaw Ravagers in Felwood.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Angerclaw Grizzly x 12\n - Felpaw Ravager x 12",
    [4124] = "Speak with Ginro Hearthkindle in Feathermoon Stronghold.",
    [4125] = "Locate the courier's boat somewhere along the coast of Feralas.",
