    [4145] = "Hunt 5 Bloodpetal Lashers, 5 Bloodpetal Threshers, 5 Bloodpetal Flayers and 5 Bloodpetal Trappers for Larion at Marshal's Refuge.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Bloodpetal Lasher x 5\n - Bloodpetal Trapper x 5\n - Bloodpetal Flayer x 5\n - Bloodpetal Thresher x 5",
    [4147] = "Travel to Marvon Rivetseeker's workshop in Ratchet.",
    [4182] = "Slay 15 Black Broodlings, 10 Black Dragonspawn, 4 Black Wyrmkin and 1 Black Drake.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Black Broodling x 15\n - Black Dragonspawn x 10\n - Black Drake x 1\n - Black Wyrmkin x 4",
    [4184] = "Travel to Stormwind and deliver Solomon's Plea to King Varian Wrynn.\n\nKing Varian Wrynn resides in Stormwind Keep.",
    [4186] = "Take Wrynn's Decree to Magistrate Solomon in Lakeshire.",
    [4223] = "Speak with Marshal Maxwell in the Burning Steppes.",
    [4224] = "Speak with Ragged John.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Ragged John's Story",
    [4243] = "Find A-Me 01 in Un'Goro Crater.",
    [4244] = "Find a Mithril Casing and return to A-Me 01 in Un'Goro Crater.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Mithril Casing x 1",
    [4245] = "Escort A-Me 01 back to Karna Remtravel in Un'Goro Crater.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Protect A-Me 01 until you reach Karna Remtravel",
    [4261] = "Escort Arei to safety, then speak with Kayneth Stillwind in Forest Song, in eastern Ashenvale.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Help Arei get to Safety",
    [4265] = "Free Raschal from the Zukk'ash hive.\n\nReturn to Ginro Hearthkindle in Feathermoon Stronghold and let him know that Raschal is alive and well.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Free Raschal.",
    [4266] = "Speak with Shandris Feathermoon in Feathermoon Stronghold.",
    [4267] = "Bring Raschal's Report to Gracina Spiritmight in Darnassus.",
    [4281] = "Bring the Undelivered Parcel to Falfindel Waywarder in Thalanaar.",
    [4283] = "Collect 50 Blackrock Medallions.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Blackrock Medallion x 50",
    [4284] = "Collect 7 Power Crystals of each color: red, blue, yellow, and green. Bring them to J.D. Collie at Marshal's Refuge.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Red Power Crystal x 7\n - Yellow Power Crystal x 7\n - Green Power Crystal x 7\n - Blue Power Crystal x 7",
    [4285] = "Discover the location of the Northern Crystal Pylon in Un'Goro Crater.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Discover and examine the Northern Crystal Pylon",
    [4287] = "Discover the location of the Eastern Crystal Pylon in Un'Goro Crater.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Discover and examine the Eastern Crystal Pylon",
    [4288] = "Discover the location of the Western Crystal Pylon.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Discover and examine the Western Crystal Pylon",
    [4289] = "Bring 2 Un'Goro Gorilla Pelts, 2 Un'Goro Stomper Pelts, and 2 Un'Goro Thunderer Pelts to Torwa Pathfinder at the entrance of Un'Goro Crater.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Un'Goro Gorilla Pelt x 2\n - Un'Goro Stomper Pelt x 2\n - Un'Goro Thunderer Pelt x 2",
    [4290] = "Find the carcass of Lar'korwi's freshest kill and steal a Piece of Threshadon Carcass before returning to Torwa Pathfinder in Un'Goro Crater.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Piece of Threshadon Carcass x 1",
    [4291] = "Bring 2 Ravasaur Pheromone Glands to Torwa Pathfinder near the entrance to Un'Goro Crater.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Ravasaur Pheromone Gland x 2",
    [4292] = "Using the contents of Torwa's Pouch, summon Lar'korwi and defeat him. Then bring Lar'korwi's Head to Torwa Pathfinder near the entrance to Un'Goro Crater.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Lar'korwi's Head x 1",
    [4293] = "Gather Felwood Slime Samples from any of the slimes in Felwood. Then, using the Testing Equipment next to Chemist Fuely in Undercity, see which of your samples are the most corrupt. Bring 5 of the Corrupted Felwood Samples you find to Chemist Fuely.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Corrupted Felwood Sample x 5",
    [4294] = "Gather Un'Goro Slime Samples from any of the slimes in Un'Goro Crater. Then, using the Testing Equipment next to Chemist Fuely in Undercity, see which of your samples are the most pure. Bring 5 of the Pure Un'Goro Samples you find to Chemist Fuely.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Pure Un'Goro Sample x 5",
    [4296] = "Collect the Tablet Transcript.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Tablet Transcript x 1",
    [4297] = "Bring 5 Silvermane Stalker Flanks to Agnar Beastamer in Hinterlands.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Silvermane Stalker Flank x 5",
    [4298] = "Speak to Agnar Beastamer in the Hinterlands.",
    [4300] = "Bring 8 White Ravasaur Claws to Jes'rimon in Orgrimmar.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - White Ravasaur Claw x 8",
    [4301] = "Bring U'cha's Pelt to Torwa Pathfinder at the entrance of Un'Goro Crater.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - U'cha's Pelt x 1",
    [4321] = "Speak with J.D. Collie in a moment.",
    [4324] = "Speak with Yuka Screwspigot in the Burning Steppes.",
    [4421] = "Kill 11 Jadefire Felsworns, 9 Jadefire Shadowstalkers, 9 Jadefire Rogues, and Xavathras. Return to Eridan Bluewind in Felwood when the task has been completed.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Jadefire Felsworn x 11\n - Jadefire Shadowstalker x 9\n - Jadefire Rogue x 9\n - Xavathras x 1",
    [4441] = "Travel to Darnassus and use Eridan's Vial to collect a Vial of Blessed Water from the Temple of the Moon. Return to Eridan with the filled vial.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Vial of Blessed Water x 1",
    [4442] = "Speak to Eridan again in a moment.",
    [4449] = "Kill 8 Dark Iron Geologists and bring 15 pieces of Silk Cloth to the person locked in the outhouse in Searing Gorge.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Dark Iron Geologist x 8\n - Silk Cloth x 15",
    [4450] = "Take the copy of Goodsteel's Ledger and then find the items listed in it before seeking Krinkle Goodsteel in Tanaris.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Goodsteel Ledger x 1\n - Solid Crystal Leg Shaft x 20\n - Overdue Package x 1\n - Goodsteel's Balanced Flameberge x 1",
