    [4486] = "Speak to Duthorian Rall in Stormwind.",
    [4490] = "Speak to Strahad Farsan in Ratchet to learn the ability to summon a Felsteed.",
    [4491] = "Lead Ringo to Spraggle Frock at Marshal's Refuge.\n\nIf Ringo faints, use Spraggle's Canteen to revive him.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Escort Ringo to Spraggle Frock at Marshal's Refuge",
    [4492] = "Find Ringo at Fire Plume Ridge.",
    [4493] = "Speak to Alchemist Pestlezugg in Gadgetzan.",
    [4494] = "Speak to Alchemist Pestlezugg in Gadgetzan.",
    [4496] = "Bring a Gorishi Scent Gland and 5 Un'Goro Soil samples to Alchemist Pestlezugg in Gadgetzan.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Gorishi Scent Gland x 1\n - Un'Goro Soil x 5",
    [4501] = "Kill 10 Frenzied Pterrordax, then speak to Spraggle Frock at Marshal's Refuge.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Frenzied Pterrordax x 10",
    [4502] = "Collect 9 samples of Un'Goro Ash from the fire elementals around the volcano in Un'Goro Crater, and return them to Liv Rizzlefix in Ratchet.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Un'Goro Ash x 9",
    [4503] = "Collect 8 Webbed Diemetradon Scales and 8 Webbed Pterrordax Scales for Shizzle in Marshal's Refuge.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Webbed Diemetradon Scale x 8\n - Webbed Pterrordax Scale x 8",
    [4504] = "Collect 12 samples of Super Sticky Tar for Tran'rek in Gadgetzan.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Super Sticky Tar x 12",
    [4505] = "Collect a sample of corrupted water from the Jadefire Satyrs' moonwell and bring it to Winna Hazzard at Bloodvenom Post.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Filled Flasket x 1",
    [4506] = "Take Winna's kitten to the corrupted moonwell, release it, then bring it back to Winna.\n\nOnce you have returned to Winna, click on the cat to release it to Winna.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Return the corrupted cat to Winna Hazzard",
    [4512] = "Bring 6 Filled Cursed Ooze Jars and 6 Filled Tainted Ooze Jars to Laris Geardawdle in Ironforge.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Filled Cursed Ooze Jar x 6\n - Filled Tainted Ooze Jar x 6",
    [4513] = "Bring 10 Filled Pure Sample Jars to Laris Geardawdle in Ironforge.\n\nIf you have trouble finding them, perhaps try to get more clues from Laris.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Filled Pure Sample Jar x 10",
    [4521] = "Trull Failbane in Felwood wants you to kill 15 Raging Owlbeasts and 15 Ragged Owlbeasts.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Raging Owlbeast x 15\n - Ragged Owlbeast x 15",
    [4642] = "Bring a Merged Ooze Sample to Chemist Fuely in Undercity.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Merged Ooze Sample x 1",
    [4721] = "Trull Failbane in Felwood wants you to hunt 10 Berserk Owlbeasts in Winterspring.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Berserk Owlbeast x 10",
    [4726] = "Bring 8 Broodling Essence and the Draco-Incarcinatrix 900 to Tinkee Steamboil at the Flame Crest in the Burning Steppes.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Broodling Essence x 8",
    [4738] = "Speak with Menara Voidrender in the Barrens.",
    [4741] = "Trull Failbane in Felwood wants you to hunt 13 Moontouched Owlbeasts.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Moontouched Owlbeast x 13",
    [4781] = "Bring a Gold Bar to Xizk Goodstitch in Stranglethorn Vale.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Gold Bar x 1",
    [4782] = "Return to Menara Voidrender in the Barrens.",
    [4783] = "Bring 10 Vials of Hatefury Blood and 1 Lesser Infernal Stone to Menara Voidrender in the Barrens.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Vial of Hatefury Blood x 10\n - Lesser Infernal Stone x 1",
    [4784] = "Bring some Fine Gold Thread, 2 Smoldering Coals, and a Soul Shard to Menara Voidrender in the Barrens.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Fine Gold Thread x 1\n - Smoldering Coal x 2\n - Soul Shard x 1",
