    [4842] = "Follow Donova Snowden's instructions, then report back.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Discover Darkwhisper Gorge",
    [4861] = "Locate Jaron Stoneshaper's wrecked camp and supplies in southern Winterspring.",
    [4863] = "Find Jaron Stoneshaper's wrecked wagon.",
    [4864] = "Pick up Jaron's Supplies from the snow, then find the wildkin that stole the amulet Jaron spoke of.\n\nBring Jaron's Supplies and the Blue-feathered Amulet to Jaron Stoneshaper at the lodge in Winterspring.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Jaron's Supplies x 1\n - Blue-feathered Amulet x 1",
    [4882] = "Take the Blue-feathered Necklace to Trull Failbane at Bloodvenom Post.",
    [4883] = "Take the Blue-feathered Necklace to Nara Wildmane.",
    [4901] = "Protect Ranshalla while she attempts to reactivate the Altar of Elune. Report your findings to Erelas Ambersky in Rut'theran Village.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Discover the secret of the Altar of Elune",
    [4902] = "Speak with Arch Druid Fandral Staghelm in Darnassus.",
    [4906] = "Eridan Bluewind in Felwood wants you to kill 8 Jadefire Hellcallers, 8 Jadefire Betrayers, 8 Jadefire Tricksters, and Xavaric. Return to Eridan when the task is completed.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Jadefire Hellcaller x 8\n - Jadefire Betrayer x 8\n - Jadefire Trickster x 8\n - Xavaric x 1",
    [4961] = "Kill the Demon of the Orb, then speak with Tabetha.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Demon of the Orb x 1",
    [4962] = "Take the Felhas Ruby and use it on one of the Felhounds found in Desolace. After successful, bring the Felhas Ruby and the Imprisoned Felhound Spirit back to Menara Voidrender in the Barrens.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Imprisoned Felhound Spirit x 1",
