    [4964] = "Wait for Menara Voidrender to complete the Orb of Dar'Orahil and then speak to her again.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Wait for Menara Voidrender to complete your item",
    [4965] = "Speak to Menara Voidrender in the Barrens.",
    [4969] = "Speak to Menara Voidrender in the Barrens.",
    [4970] = "Collect 5 Shardtooth Meats and 5 Chillwind Meats for Rivern Frostwind in Winterspring.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Shardtooth Meat x 5\n - Chillwind Meat x 5",
    [4971] = "Use the Temporal Displacer near one of Andorhal's silos and uncover Temporal Parasites.\n\nSlay 10 Temporal Parasites, and then return the Temporal Displacer to Chromie in the Andorhal Inn, Western Plaguelands.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Temporal Parasite x 10",
    [4972] = "Locate 5 Andorhal Watches, found in lockboxes amongst the rubble of the city.  Return with them to Chromie in the Andorhal Inn, Western Plaguelands.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Andorhal Watch x 5",
    [4976] = "Return the Cleansed Infernal Orb to Menara Voidrender in the Barrens.",
    [4984] = "Destroy 8 Diseased Wolves, and then return to Mulgris Deepriver at the Writhing Haunt, Western Plaguelands.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Diseased Wolf x 8",
    [4985] = "Destroy 8 Diseased Grizzlies, and then return to Mulgris Deepriver at the Writhing Haunt, Western Plaguelands.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Diseased Grizzly x 8",
    [4986] = "Based on the magic enchanted within the Glyphed Oaken Branch, its delivery to the Cenarion Circle in Darnassus is the next step the tauren druid sought.  Seek one of the druids there for assistance.",
    [4987] = "Based on the magic enchanted within the Glyphed Oaken Branch, its delivery to the Cenarion Circle in Thunder Bluff is the next step the tauren druid sought.  Seek one of the druids there for assistance.",
    [5021] = "The ramblings of the ghostly woman indicated that she needed a package delivered.  She claimed that it was where her horse was.  As to where the horse is or where the package was to be delivered - the ghost remains incomprehensible.",
    [5022] = "Check with the Royal Factors of Stormwind to learn the whereabouts of an Emma Felstone.  There is usually a census officer located in City Hall.",
    [5023] = "Check with the Royal Overseers of the Undercity to learn the whereabouts of a Jeremiah Felstone.  There is usually a census officer located near guild and tabard registration.",
    [5048] = "Find Ol' Emma in Stormwind and see if she is in fact Emma Felstone.  If she is, then perhaps she'd like the package Janice Felstone made for her.",
    [5049] = "Find Jeremiah Payson in the Undercity and see if he is in fact Jeremiah Felstone.  If he is, then perhaps he'd like the package Janice Felstone made for him.",
    [5050] = "Return to Janice Felstone in Western Plaguelands her Good Luck Half-Charm.",
    [5051] = "Locate the other half of the Good Luck Charm somewhere on the Felstone Farm in Western Plaguelands and reassemble it.\n\nGive the Good Luck Charm to Janice Felstone on the Felstone Farm, Western Plaguelands.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Good Luck Charm x 1",
    [5054] = "Storm Shadowhoof at Everlook in Winterspring wants you to kill Ursius.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Ursius x 1",
    [5055] = "Storm Shadowhoof at Everlook in Winterspring wants you to kill Brumeran.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Brumeran x 1",
    [5060] = "|Cffffd100Requirements:|r\n - Dalson Cabinet Key x 1",
    [5066] = "Seek out Commander Ashlam Valorfist.  His base camp is located at Chillwind Camp, north of the Alterac Mountains.",
