    [5096] = "Proceed to the Scarlet Crusade's base camp between Felstone Field and Dalson's Tears and destroy their command tent.\n\nPlace the Scourge banner at the camp, and then return to High Executor Derrington at the Bulwark, Western Plaguelands.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Destroy the command tent and plant the Scourge banner in the camp",
    [5097] = "Using the Beacon Torch, mark each tower in Andorhal; you will need to stand in the doorway of the tower to successfully mark it.\n\nOnce all four towers are marked, return the Beacon Torch to Commander Ashlam Valorfist in Chillwind Camp, Western Plaguelands.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Tower One marked x 1\n - Tower Two marked x 1\n - Tower Three marked x 1\n - Tower Four marked x 1",
    [5098] = "Using the Beacon Torch, mark each tower in Andorhal; you will need to stand in the doorway of the tower to successfully mark it.\n\nOnce all four towers are marked, return the Beacon Torch to High Executor Derrington at the Bulwark, Western Plaguelands.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Tower One marked x 1\n - Tower Two marked x 1\n - Tower Three marked x 1\n - Tower Four marked x 1",
    [5121] = "Donova Snowden in Winterspring wants you to defeat High Chief Winterfall.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - High Chief Winterfall x 1",
    [5149] = "Find Pamela's doll.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Pamela's Doll x 1",
