    [5153] = "Bring Joseph's Wedding Ring to Chromie.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Joseph's Wedding Ring x 1",
    [5154] = "Bring the Annals of Darrowshire to Chromie in Andorhal.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Annals of Darrowshire x 1",
    [5155] = "Enter Jaedenar and slay 4 Jaedenar Hounds, 4 Jaedenar Guardsmen, 6 Jaedenar Adepts, and 6 Jaedenar Cultists before returning to Greta Mosshoof in Felwood.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Jaedenar Hound x 4\n - Jaedenar Guardian x 4\n - Jaedenar Adept x 6\n - Jaedenar Cultist x 6",
    [5156] = "Seek out and destroy 2 Entropic Beasts and 2 Entropic Horrors while exploring Shatter Scar Vale. After checking to see if the craters there are still filled with corrupt fel water, return to Taronn Redfeather in Felwood.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Entropic Beast x 2\n - Entropic Horror x 2\n - Explore the craters in Shatter Scar Vale",
    [5157] = "Take the Empty Canteen to the Moon Well in the center of Jaedenar and fill it before returning to Greta Mosshoof in Felwood.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Corrupt Moonwell Water x 1",
    [5158] = "Take the Corrupt Moon Well Water to Islen Waterseer in the Barrens.",
    [5159] = "Take the Purified Moon Well Water to Greta Mosshoof in Felwood.",
    [5163] = "Take Umi's Mechanical Yeti and scare her friends with it:\n\nLegacki in Everlook (Winterspring)\nSprinkle in Gadgetzan (Tanaris)\nQuixxil in Marshal's Refuge (Un'Goro Crater)\n\nWhen you are done, bring the Mechanical Yeti back to Umi.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Scare Legacki x 1\n - Scare Sprinkle x 1\n - Scare Quixxil x 1",
    [5165] = "Using the Purified Moon Well Water, douse the flames of the four braziers of protection within Shadow Hold in Felwood, then return to Greta Mosshoof in the Emerald Sanctuary.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Extinguish the Brazier of Pain x 1\n - Extinguish the Brazier of Malice x 1\n - Extinguish the Brazier of Suffering x 1\n - Extinguish the Brazier of Hatred x 1",
    [5181] = "Bring the Skull of Horgus and the Shattered Sword of Marduk to Carlin Redpath at Light's Hope Chapel.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Skull of Horgus x 1\n - Shattered Sword of Marduk x 1",
    [5210] = "Bring the Extended Annals of Darrowshire to Carlin Redpath in Eastern Plaguelands.",
    [5211] = "Free 15 Darrowshire Spirits and return to Carlin Redpath.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Darrowshire Spirits Freed x 15",
    [5215] = "Speak with High Priestess MacDonnell at Chillwind Point, Western Plaguelands.",
    [5216] = "Go to Felstone Field in Western Plaguelands to locate and defeat the Cauldron Lord present there.  It may have a key that will allow access to the cauldron.  You must have the Empty Felstone Field Bottle with you to secure a sample of the poisons used inside the cauldron.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Felstone Field Cauldron Key x 1",
    [5217] = "Bring the Filled Felstone Field Bottle to High Priestess MacDonnell at Chillwind Camp, Western Plaguelands.",
    [5219] = "Go to Dalson's Tears in Western Plaguelands to locate and defeat the Cauldron Lord present there, and use its key to gain access to the cauldron.  You must have the Empty Dalson's Tears Bottle with you to secure a sample of the poisons used inside the cauldron.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Dalson's Tears Cauldron Key x 1",
    [5220] = "Bring the Filled Dalson's Tears Bottle to High Priestess MacDonnell at Chillwind Camp, Western Plaguelands.",
    [5222] = "Go to the Writhing Haunt in Western Plaguelands to locate and defeat the Cauldron Lord present there, and use its key to gain access to the cauldron.  You must have the Empty Writhing Haunt Bottle with you to secure a sample of the poisons used inside the cauldron.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Writhing Haunt Cauldron Key x 1",
    [5223] = "Bring the Filled Writhing Haunt Bottle to High Priestess MacDonnell at Chillwind Camp, Western Plaguelands.",
    [5225] = "Go to Gahrron's Withering in Western Plaguelands to locate and defeat the Cauldron Lord present there, and use its key to gain access to the cauldron.  You must have the Empty Gahrron's Withering Bottle with you to secure a sample of the poisons used inside the cauldron.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Gahrron's Withering Cauldron Key x 1",
    [5226] = "Bring the Filled Gahrron's Withering Bottle to High Priestess MacDonnell at Chillwind Camp, Western Plaguelands.",
    [5228] = "Speak with Shadow Priestess Vandis at the Bulwark, Western Plaguelands.",
    [5229] = "Go to Felstone Field in Western Plaguelands to locate and defeat the Cauldron Lord present there.  It may have a key that will allow access to the cauldron.  You must have the Empty Felstone Field Bottle with you to secure a sample of the poisons used inside the cauldron.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Felstone Field Cauldron Key x 1",
    [5230] = "Bring the Filled Felstone Field Bottle to Shadow Priestess Vandis at the Bulwark, Western Plaguelands.",
    [5231] = "Go to Dalson's Tears in Western Plaguelands to locate and defeat the Cauldron Lord present there, and use its key to gain access to the cauldron.  You must have the Empty Dalson's Tears Bottle with you to secure a sample of the poisons used inside the cauldron.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Dalson's Tears Cauldron Key x 1",
    [5232] = "Bring the Filled Dalson's Tears Bottle to Shadow Priestess Vandis at the Bulwark, Western Plaguelands.",
    [5233] = "Go to the Writhing Haunt in Western Plaguelands to locate and defeat the Cauldron Lord present there, and use its key to gain access to the cauldron.  You must have the Empty Writhing Haunt Bottle with you to secure a sample of the poisons used inside the cauldron.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Writhing Haunt Cauldron Key x 1",
    [5234] = "Bring the Filled Writhing Haunt Bottle to Shadow Priestess Vandis at The Bulwark, Western Plaguelands.",
    [5235] = "Go to Gahrron's Withering in Western Plaguelands to locate and defeat the Cauldron Lord present there, and use its key to gain access to the cauldron.  You must have the Empty Gahrron's Withering Bottle with you to secure a sample of the poisons used inside the cauldron.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Gahrron's Withering Cauldron Key x 1",
    [5236] = "Bring the Filled Gahrron's Withering Bottle to Shadow Priestess Vandis at the Bulwark, Western Plaguelands.",
    [5241] = "Find Carlin Redpath.",
    [5242] = "Kill Moora and Salia, and bring Shadow Lord Fel'dan's Head to Greta Mosshoof in Felwood.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Moora x 1\n - Salia x 1\n - Shadow Lord Fel'dan's Head x 1",
    [5244] = "Speak with Jaron Stoneshaper in Starfall Village.",
    [5245] = "Use Jaron's Pick to find the four Highborne Relic Fragments. Bring them to Aurora Skycaller in Eastern Plaguelands.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - First Relic Fragment x 1\n - Second Relic Fragment x 1\n - Third Relic Fragment x 1\n - Fourth Relic Fragment x 1",
    [5246] = "Find the Sacred Highborne Writings in the Temple of Zin-Malor in Azshara, and bring them to Aurora Skycaller near the Northpass Tower in Eastern Plaguelands.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Sacred Highborne Writings x 1",
    [5249] = "Find Starfall Village in Winterspring and speak with Wynd Nightchaser.",
    [5250] = "Find Starfall in Winterspring and speak with Wynd Nightchaser.",
    [5281] = "Find Egan. You only know that he was last seen around Stratholme.",
    [5361] = "Deliver Cliffwatcher Longhorn Report to Nataka Longhorn at Ghost Walker Post in Desolace.",
    [5381] = "Retrieve the Demon Box from Thunder Axe Fortress, and return it, along with the Demon Pick to Taiga Wisemane in Shadowprey Village.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Demon Box x 1",
    [5386] = "Talk to Jinar'Zillen at Shadowprey Village, and then bring Nataka Longhorn 2 Bloodbelly fish.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Bloodbelly Fish x 2",
    [5421] = "|Cffffd100Requirements:|r\n - Shellfish x 5",
    [5501] = "Bring 10 Kodo Bones from the Kodo Graveyard to Bibbly F'utzbuckle at Kormek's Hut.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Kodo Bone x 10",
    [5510] = "|Cffffd100Requirements:|r\n - Minion's Scourgestone x 20",
    [5527] = "Travel to Silithus and search for a Reliquary of Purity within the ruins of Southwind Village.  If you are able to find it, return with it to Rabine Saturna in Nighthaven, Moonglade.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Reliquary of Purity x 1",
    [5533] = "Speak with Alchemist Arbington at Chillwind Point, Western Plaguelands.",
    [5534] = "Find Some Rune that the naga have in their possession in the Ruins of Eldarath and return it to Kim'jael in Azshara.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Some Rune x 1",
    [5535] = "Destroy 6 Highborne Apparitions and 6 Highborne Lichlings before returning to Loh'atu in Azshara.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Highborne Apparition x 6\n - Highborne Lichling x 6",
    [5536] = "Kill 6 Haldarr Satyr, 2 Haldarr Tricksters, 2 Haldarr Felsworn and then return to Loh'atu on the border of Ashenvale.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Haldarr Satyr x 6\n - Haldarr Trickster x 2\n - Haldarr Felsworn x 2",
    [5537] = "Bring 15 Skeletal Fragments to Alchemist Arbington at Chillwind Point, Western Plaguelands.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Skeletal Fragments x 15",
    [5542] = "Slay 20 Plaguehound Runts, 5 Plaguehounds and 5 Frenzied Plaguehounds. Return to Tirion Fordring when the task is complete.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Plaguehound Runt x 20\n - Plaguehound x 5\n - Frenzied Plaguehound x 5",
    [5543] = "Slay 30 Plaguebats and return to Tirion Fordring.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Plaguebat x 30",
    [5544] = "Seek out the Carrion Grubs and Devourers of the region. Slay them and harvest their meat. Return to Tirion Fordring when you have gathered 15 Slabs of Carrion Worm Meat.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Slab of Carrion Worm Meat x 15",
    [5581] = "Banish 6 Portals at Mannoroc Coven and return to Taiga Wisemane at Shadowprey Village.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Portals Banished x 6",
    [5601] = "Find Pamela Redpath in Darrowshire.",
    [5655] = "Speak to Ur'kyo in Orgrimmar.",
    [5742] = "Listen to what Tirion Fordring has to say.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Tirion's Tale",
    [5781] = "Travel to the Undercroft - at the southernmost section of the Eastern Plaguelands - and recover Taelan's Hammer. Return to Tirion Fordring upon completion of your objective.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Taelan's Hammer x 1",
    [5845] = "Travel to Northdale, in the northeastern region of the Eastern Plaguelands, and recover the Symbol of Lost Honor. Return to Tirion Fordring upon completion of your objective.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Symbol of Lost Honor x 1",
    [5846] = "Travel to island of Caer Darrow, in the south-central region of the Plaguelands, and look for any clues as to the whereabouts of the painting.",
    [5863] = "Andi Lynn in Gadgetzan wants you to destroy the Dunemaul Compound by killing 10 Dunemaul Brutes, 10 Dunemaul Enforcers, and Gor'marok the Ravager.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Dunemaul Brute x 10\n - Dunemaul Enforcer x 10\n - Gor'marok the Ravager x 1",
    [5882] = "|Cffffd100Requirements:|r\n - Corrupted Soul Shard x 6",
    [5901] = "Use the Empty Termite Jar on the Termite Mounds in Eastern Plaguelands. After you've gathered 100 Plagueland Termites, return to Mickey Levine at the Bulwark in Tirisfal Glades.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Plagueland Termites x 100",
    [5902] = "Find someplace suitable in the center of the Northridge Lumber Mill in Western Plaguelands to place the Barrel of Plagueland Termites.",
    [5903] = "Use the Empty Termite Jar on the Termite Mounds in Eastern Plaguelands. After you've gathered 100 Plagueland Termites, return to Nathaniel Dumah at Chillwind Camp in Western Plaguelands.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Plagueland Termites x 100",
    [5904] = "Find someplace suitable in the center of the Northridge Lumber Mill in Western Plaguelands to place the Barrel of Plagueland Termites.",
    [5943] = "Escort the Gizelton Caravan through Mannoroc Coven. Talk with Smeed at Scrabblescrew's Camp for your reward.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Escort Gizelton Caravan past Mannoroc Coven",
    [6004] = "Kill 2 Scarlet Medics, 2 Scarlet Hunters, 2 Scarlet Magi and 2 Scarlet Knights before returning to Kirsta Deepshadow in Western Plaguelands.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Scarlet Medic x 2\n - Scarlet Hunter x 2\n - Scarlet Mage x 2\n - Scarlet Knight x 2",
    [6021] = "Bring Zaeldarr's Head to Caretaker Alen at Light's Hope Chapel.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Zaeldarr's Head x 1",
    [6022] = "Travel to Corin's Crossing to the east and slaughter the Scourge that inhabit the town. Collect 7 pieces of Living Rot in under 10 minutes. Use the Mortar and Pestle to grind the Living Rot into Coagulated Rot.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Coagulated Rot x 1",
    [6023] = "Kill Huntsman Radley and Cavalier Durgen before returning to Kirsta Deepshadow in Western Plaguelands.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Huntsman Radley x 1\n - Cavalier Durgen x 1",
    [6024] = "Kill Infiltrator Hameya.  Use his key on the Mound of Dirt behind the Undercroft.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Hameya's Key x 1",
    [6025] = "Enter Hearthglen and find a high vantage point from which you can see the town and gauge the Scarlet Crusade's forces, then return to Kirsta Deepshadow in Western Plaguelands.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Overlook Hearthglen from a high vantage point",
    [6026] = "Smokey LaRue wants you to get 2 Thorium Bars, 1 Golden Rod, 8 Hi-Explosive Bombs, and 8 Unstable Triggers.\n\nYou will have to find a blacksmith and an engineer for these items.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Thorium Bar x 2\n - Golden Rod x 1\n - Hi-Explosive Bomb x 8\n - Unstable Trigger x 8",
    [6027] = "Get the Book of the Ancients and return it to Azore Aldamort at the tower in Ethel Rethor.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Book of the Ancients x 1",
    [6028] = "Deliver the Everlook Report to Argent Officer Pureheart at Chillwind Camp, Western Plaguelands.",
    [6029] = "Deliver the Everlook Report to Argent Officer Garush at the Bulwark, Western Plaguelands.",
    [6030] = "Deliver the book, \"Studies in Spirit Speaking\", to Duke Nicholas Zverenhoff at Light's Hope Chapel, Eastern Plaguelands.",
    [6041] = "Travel to Plaguewood, northwest of Light's Hope. Destroy 8 Scourge Structures by using Smokey's Special Compound at the Mark of Detonation planted inside each building. Smokey has had the Ziggurats and Slaughterhouses marked.\n\nOnce you plant the bomb, leave the building and marvel at your handiwork.\n\nBy the way, Smokey's Special Compound is rather... unstable.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Scourge Structures Destroyed x 8",
    [6042] = "Slay 20 Noxious Plaguebats and 10 Monstrous Plaguebats. Return to Nathanos Blightcaller when you are finished.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Noxious Plaguebat x 20\n - Monstrous Plaguebat x 10",
    [6133] = "Travel to the northern borders of the Eastern Plaguelands and recover the Quel'Thalas Registry. The item is somewhere in the Quel'Lithien lodge.\n\nYou must also slay 8 Rangers, 8 Pathstriders, and 8 Woodsmen.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Pathstrider x 8\n - Ranger x 8\n - Woodsman x 8\n - Quel'Thalas Registry x 1",
    [6134] = "Bring 8 Ghost-o-plasms and the Crate of Ghost Magnets to Hornizz Brimbuzzle in Desolace.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Ghost-o-plasm x 8",
    [6135] = "Find Duskwing and slay him. From the corpse, recover a Patch of Duskwing's Fur and return it to Nathanos Blightcaller.\n\nIt is said that Duskwing roams the countryside to the north of Marris Stead.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Patch of Duskwing's Fur x 1",
    [6136] = "Find Borelgore in the northern wastes of Eastern Plaguelands and destroy him. Return to Nathanos Blightcaller when the mission is complete.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Borelgore x 1",
    [6141] = "Speak with Brother Anton at Nijel's Point in Desolace.",
    [6142] = "Find 10 pieces of Soft-shelled Clam Meat and bring it back to Mai'Lahii at Shadowprey Village.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Soft-shelled Clam Meat x 10",
    [6143] = "Slay 7 Slitherblade Myrmidon, 7 Slitherblade Naga, and 5 Slitherblade Sorceresses, and then talk to Drulzegar at Shadowprey in Desolace.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Slitherblade Myrmidon x 7\n - Slitherblade Naga x 7\n - Slitherblade Sorceress x 5",
    [6162] = "Kill Overlord Ror and return his claw to Dreka'Sur at Bloodvenom Post in Felwood.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Overlord Ror's Claw x 1",
    [6164] = "Get Augustus' Receipt Book from the inn in Terrordale.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Augustus' Receipt Book x 1",
    [6182] = "Speak with Mathias Shaw in Old Town Stormwind. He resides in the Barracks.",
    [6183] = "Speak with Mathias Shaw again if you wish to accept his task.",
    [6184] = "Travel to Chillwind Camp in the Western Plaguelands and meet up with your contact, Flint Shadowmore.",
    [6185] = "Scour the Eastern Plaguelands for clues as to the \"Blightcaller\" and the missing SI:7 agents. If you find any SI:7 Insignias, return them to Flint Shadowmore at Chillwind Camp.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - SI:7 Insignia (Rutger) x 1\n - SI:7 Insignia (Fredo) x 1\n - SI:7 Insignia (Turyen) x 1\n - The Blightcaller Uncovered",
    [6186] = "Return to Stormwind and inform King Varian Wrynn of the fate of Nathanos Marris.",
    [6187] = "Assemble an army and travel to the Eastern Plaguelands. Launch a full assault on Nathanos Blightcaller and any Horde filth that may attempt to protect him.\n\nKeep your wits about you, Tomcatdk. The Horde will defend the ranger lord with their very lives.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Nathanos Blightcaller x 1",
    [6389] = "Release the Plagueland Termites in the Northridge Lumber Mill, then return with the Barrel of Plagueland Termites to Nathaniel Dumah at Chillwind Camp in Western Plaguelands.",
    [6390] = "Release the Plagueland Termites in the Northridge Lumber Mill, then return with the Barrel of Plagueland Termites to Mickey Levine at the Bulwark in Tirisfal Glades.",
    [6622] = "Save patients by using Triage Bandages to tend to their wounds. You must save 15 patients before 6 of them die from their injuries.\n\nRemember the order of triage! Critically Injured Soldiers die the fastest followed by Badly Injured Soldiers. Injured Soldiers take the longest to die and should be saved AFTER your Critically Injured and Badly Injured Soldiers have been triaged.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - 15 Patients Saved!",
    [6624] = "Save patients by using Triage Bandages to tend to their wounds. You must save 15 patients before 6 of them die from their injuries.\n\nRemember the order of triage! Critically Injured Soldiers die the fastest followed by Badly Injured Soldiers. Injured Soldiers take the longest to die and should be saved AFTER your Critically Injured and Badly Injured Soldiers have been triaged.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - 15 Patients Saved!",
    [6761] = "Speak with Mathrengyl Bearwalker at the Cenarion Enclave of Darnassus.",
    [6762] = "Speak with Rabine Saturna in the village of Nighthaven, Moonglade.  Moonglade lies between Felwood and Winterspring, accessible through a path out of Timbermaw Hold.",
    [6844] = "Take the Encrusted Silithid Object to Umber - the Cenarion Circle's archivist - in the village of Nighthaven, Moonglade.",
    [6845] = "Speak with Rabine Saturna in the village of Nighthaven, Moonglade.",
    [7003] = "Use Zorbin's Ultra-Shrinker to zap any kind of giant found in Feralas into a more manageable form.  Bring 15 Miniaturization Residues found on the zapped versions of these giants to Zorbin Fandazzle at the docks of the Forgotten Coast, Feralas.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Miniaturization Residue x 15",
    [7492] = "Speak with Talo Thornhoof at Camp Mojache in Feralas.",
    [7601] = "Speak with Impsy in Felwood.",
    [7701] = "Deep within the Slag Pit of the Cauldron, in the Searing Gorge, you will find the traitorous Dark Iron dwarf named Overseer Maltorius.\n\nSlay Overseer Maltorius and take his head. Return the head to Lookout Captain Lolo Longstriker in the Searing Gorge for your reward.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Head of Overseer Maltorius x 1",
    [7702] = "Deep within the Slag Pit of the Cauldron, you will find the sleeping quarters of the Dark Iron dwarves.\n\nTravel to the sleeping quarters and steal 20 Dark Iron Pillows. Return to Evonice Sootsmoker in the Searing Gorge when you have accomplished this task.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Dark Iron Pillow x 20",
    [7721] = "Collect 10 Water Elemental Cores from the Sea Elementals and Sea Sprays along the Forgotten Coast of Feralas, and bring them back to Zorbin Fandazzle who is near the dock there.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Water Elemental Core x 10",
    [7722] = "Somewhere in the Slag Pit of the Cauldron you will find the Secret Plans: Fiery Flux that Overseer Maltorius stole. Find those plans and return them to Master Smith Burninate in the Searing Gorge.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Secret Plans: Fiery Flux x 1",
    [7723] = "Hansel Heavyhands wants you to kill 20 Heavy War Golems.\n\nThe Heavy War Golems wander the areas surrounding the Cauldron in the Searing Gorge. When you've killed enough, return to Hansel in Searing Gorge.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Heavy War Golem x 20",
    [7724] = "Hansel Heavyhands wants you to kill 20 Greater Lava Spiders in the Searing Gorge. You can find Greater Lava Spiders in the plateaus and lava pools of the Searing Gorge.\n\nReturn to Hansel Heavyhands in the Searing Gorge when you have killed enough Greater Lava Spiders.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Greater Lava Spider x 20",
    [7727] = "Hansel Heavyhands wants you to kill 20 Incendosaurs.\n\nYou will find Incendosaurs occupying the lava pools inside the Slag Pit. The Slag Pit can be found in the Cauldron of the Searing Gorge.\n\nReturn to Hansel Heavyhands in the Searing Gorge when you have killed enough Incendosaurs.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Incendosaur x 20",
    [7728] = "Find and return the Smithing Tuyere and Lookout's Spyglass to Taskmaster Scrange in the Searing Gorge.\n\nThe only information you have about these items is the following: They were definitely stolen by Dark Iron dwarves. The Smithing Tuyere is a blacksmithing tool used by blacksmiths and the Lookout's Spyglass is an invaluable monitoring tool to lookouts. \n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Smithing Tuyere x 1\n - Lookout's Spyglass x 1",
    [7729] = "Slay 15 Dark Iron Taskmasters and 15 Dark Iron Slavers. Return to Taskmaster Scrange in the Searing Gorge once you have accomplished this task.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Dark Iron Taskmaster x 15\n - Dark Iron Slaver x 15",
    [7730] = "Bring 20 Zukk'ash Carapaces to Hadoken Swiftstrider at Camp Mojache, Feralas.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Zukk'ash Carapace x 20",
    [7731] = "Defeat Stinglasher in the Writhing Deep, bringing its glands back to Hadoken Swiftstrider at Camp Mojache, Feralas.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Stinglasher's Glands x 1",
