    [7815] = "Katoom the Angler at Revantusk Village in the Hinterlands wants you to kill 10 Saltwater Snapjaw turtles. Return to him when you have completed this task.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Saltwater Snapjaw x 10",
    [7816] = "Katoom the Angler at Revantusk Village in the Hinterlands wants you to kill Gammerita and retrieve Katoom's Best Lure from her corpse.\n\nKatoom mentioned that Gammerita hangs out on the coast with the other turtles.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Katoom's Best Lure x 1",
    [7817] = "|Cffffd100Requirements:|r\n - Mageweave Cloth x 60",
    [7828] = "Huntsman Markhor at Revantusk Village in the Hinterlands wants you to kill 5 Silvermane Stalkers and 5 Silvermane Howlers. Return to him once the task is complete.\n\nMarkhor mentioned that the wolves hide in the wilds of the Hinterlands.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Silvermane Stalker x 5\n - Silvermane Howler x 5",
    [7829] = "Huntsman Markhor at Revantusk Village in the Hinterlands wants you to kill 10 Savage Owlbeasts. Return to him once the task is complete.\n\nMarkhor mentioned that the Savage Owlbeasts occupy the wilds of the Hinterlands.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Savage Owlbeast x 10",
    [7830] = "Huntsman Markhor at Revantusk Village in the Hinterlands wants you to kill a Razorbeak Skylord and retrieve its Skylord Plume. Return to him once the task is complete.\n\nMarkhor mentioned that the Razorbeak Skylord are a rare breed that tend to occupy the wilds of the Hinterlands.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Skylord Plume x 1",
    [7839] = "Smith Slagtree at Revantusk Village in the Hinterlands wants you to find Slagtree's Lost Tools. Return to him once this task is complete.\n\nYou recall Smith Slagtree mentioning that the tools might be at one of the Vilebranch temples in the northeastern region of the Hinterlands. You should also check Skulk Rock.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Slagtree's Lost Tools x 1",
    [7840] = "Lard at Revantusk Village in the Hinterlands wants you to find Lard's Lunch. Return to him when this task is complete.\n\nLard mentioned that he left it on the island to the north. Watch out for Vilebranch trolls.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Lard's Lunch x 1",
    [7841] = "Otho Moji'ko at Revantusk Village in the Hinterlands wants you to slaughter 8 Highvale Scouts, 5 Highvale Outrunners, 5 Highvale Rangers and 2 Highvale Marksman. Return to him when this task is complete.\n\nYou can find the Highvale high elves at the Quel'Danil Lodge in the northwestern region of the Hinterlands.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Highvale Scout x 8\n - Highvale Outrunner x 5\n - Highvale Ranger x 5\n - Highvale Marksman x 2",
    [7842] = "Otho Moji'ko at Revantusk Village in the Hinterlands wants you to bring him 1 Long Elegant Feather from the gryphons that inhabit the Hinterlands. Return to him once this task is complete.\n\nGryphons are known to inhabit every region of the Hinterlands.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Long Elegant Feather x 1",
    [7843] = "Otho Moji'ko at Revantusk Village in the Hinterlands wants you to travel to Aerie Peak in the western region of the Hinterlands and place the Final Message to the Wildhammer by the well in the center of town. Return to him once this task is complete.\n\nBeware of angry Wildhammer dwarves and unruly members of the Alliance.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Message to the Wildhammer Delivered",
    [7844] = "Mystic Yayo'jin at Revantusk Village in the Hinterlands wants you to kill 6 Vilebranch Scalpers and 2 Vilebranch Soothsayers. Return to her when this task is complete.\n\nYayo'jin indicated that these trolls could be found near the Shaol'watha and Agol'watha temples in the north by northeastern region of the Hinterlands.\n|Cffffd100 |r\n|Cffffd100Requirements:|r\n - Vilebranch Scalper x 6\n - Vilebranch Soothsayer x 2",
